    public function __construct() {
        $this->icons = apply_filters( 'wpremark_icons', $this->icons );
    }


    public function get_icon( $name, $params = [] ) {

        $params = wp_parse_args($params, [
            'width' => '',
            'height' => '',
            'color' => '',
        ]);

        if ( isset( $this->icons[ $name ] ) ) {

            $color = 'currentColor';
            if ( ! empty( $params['color'] ) ) $color = $params['color'];

            $viewbox_width = $this->icons[ $name ]['width'];
            $viewbox_height = $this->icons[ $name ]['height'];

            $svg = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 ' . $viewbox_width . ' ' . $viewbox_height . '"';
            if ( ! empty( $params['width'] ) ) $svg .= ' width="' . $params['width'] . '"';
            if ( ! empty( $params['height'] ) ) $svg .= ' height="' . $params['height'] . '"';
            $svg .= '>';

//            $svg .= '<linearGradient id="g" y2="100%">';
//            $svg .= '<stop offset="10%" stop-color="#0bcdd6"/>';
//            $svg .= '<stop offset="100%" stop-color="#0b67d6"/>';
//            $svg .= '</linearGradient>';

            $svg .= '<path d="' . $this->icons[ $name ]['path'] . '" fill="' . $color . '"/>'; //fill="currentColor"url(#g)
            $svg .= '</svg>';
            return $svg;
        }

        return false;
    }

    public function get_icons() {

        $current_icons = $this->icons;
        $icons = [];

        foreach ( $this->get_groups() as $group_key => $group ) {
            foreach ( $group['items'] as $item ) {
                $icons[$item] = $this->icons[$item];
                unset( $current_icons[$item] );
            }
        }

        return array_merge( $icons, $current_icons );
    }

    public function get_groups() {
        return $this->groups;
    }

